2 3/4in. chambers, bored approx. 1/4 and 1/2 choke; 
self-opening treble-grip action with side-clips, removable striker discs, automatic safety with gold-inlaid 'SAFE' detail, cocking-indicators, fences deeply carved in relief with oak leaves and acorns, the action, lockplates and furniture deeply carved with best bold acanthus scroll engraving on a matt background, retaining traces of original colour-hardening and finish, 16in. highly-figured replacement stock including 1/2in. rubber recoil pad, and replacement semi-beavertail fore-end, weight 6lb. 12oz., in an oak and leather case with J. Purdey trade label and provision for both sets of barrels, together with the original stock and fore-end wood.
  Purdey has confirmed that the gun was completed in 1934 as No.1 of a pair made for the King of Romania.
